	"web/ui5/test-resources/sap/ui/rta/testdata/demoapp_md/i18n/i18n.properties": "#XTIT: Application Title\r\nappTitle=RTA Demo: Track Sales Order\r\n#XTXT: Application Description\r\nappDescription=Demo Application for Runtime Adaptation: Track Sales Order\r\n\r\n#~~~ Additional Texts ~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Purchase Order\r\nPO=Purchase Order\r\n\r\n#XTIT: Purchase Order Prefix PO\r\nPOPrefix=PO\r\n\r\n#XTIT: Pruchase Order not available (n/a)\r\nPOnotAvailable=n/a\r\n\r\n#~~~ Master View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Sales Order text\r\nmasterTitle=Sales Order\r\n\r\n#XTIT: Sales Order short text\r\nmasterTitleShort=SO\r\n\r\n#XTIT: Master view title with placeholder for the number of items\r\nmasterTitleCount=Sales Orders ({0})\r\n\r\n#XTOL: Tooltip for the search field\r\nmasterSearchTooltip=Enter a Sales Order number or a part of it.\r\n\r\n#XBLI: text for a list with no data\r\nmasterListNoDataText=No Sales Orders are currently available\r\n\r\n#XBLI: text for a list with no data with filter or search\r\nmasterListNoDataWithFilterOrSearchText=No matching Sales Order found\r\n\r\n#~~~ Detail View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Detail view title\r\ndetailTitle=Track Sales Orders\r\n\r\n#XBUT: Adapt the UI with Runtime Adaptation\r\nbtnAdapt=Adapt UI\r\n\r\n#~~~ Object Header\r\n\r\n#XTIT: Object Header title 'Sales Order'\r\nobjectHeaderTitle=Sales Order\r\n\r\n#XTIT: Object Header Purchase Order attribute\r\nobjectHeaderAttributePO=PO\r\n\r\n#XTIT: Object Header Ordered attribute\r\nobjectHeaderAttributeOrdered=Ordered\r\n\r\n#XTIT: Object Header Requested attribute\r\nobjectHeaderAttributeRequested=Requested\r\n\r\n#XTIT: Object Header Ship To attribute\r\nobjectHeaderAttributeShipTo=Ship-To Party\r\n\r\n#XTIT: Object Header attribute 'Posting Date'\r\nobjectHeaderAttribute1=Posting Date\r\n\r\n#XTIT: Object Header Status 'Estimated Arrival'\r\nobjectHeaderStatusEstimatedArrival=Estimated Arrival\r\n\r\n#XTIT: Object Header Status 'Overall Status Code'\r\nobjectHeaderStatusOverallStatusCode=Overall Status\r\n\r\n#XTIT: Object Header Status 'Shipping Status Code'\r\nobjectHeaderStatusShippingStatusCode=Shipping Status\r\n\r\n#XTIT: Smartform Group 'Genral Data'\r\nsmartFormGroup1=General Data\r\n\r\n#XTIT: Smartform Group 'Contact Data'\r\nsmartFormGroup2=Contact Data\r\n\r\n#XTIT: Smartform Group 'Dates'\r\nsmartFormGroup3=Dates\r\n\r\n#XTIT: Save as tile app title\r\nshareSaveTileAppTitle=Sales Orders - {0}\r\n\r\n#XTIT: Send E-Mail subject\r\nshareSendEmailObjectSubject=Sales Order {0}\r\n\r\n#YMSG: Send E-Mail message\r\nshareSendEmailObjectMessage=Hello, have a look at this {0} (Nr.: {1})\\r\\n{2}\r\n\r\n#~~~ Not Found View ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Not found view title\r\nnotFoundTitle=Not Found\r\n\r\n#YMSG: The Sales Orders not found text is displayed when there is no Sales Orders with this id\r\nnoObjectFoundText=This Sales Orders is not available\r\n\r\n#YMSG: The Sales Orders not available text is displayed when there is no data when starting the app\r\nnoObjectsAvailableText=No Sales Orders are currently available\r\n\r\n#YMSG: The not found text is displayed when there was an error loading the resource (404 error)\r\nnotFoundText=The requested resource was not found\r\n\r\n#~~~ Not Available View ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Master view title\r\nnotAvailableViewTitle=Sales Orders\r\n\r\n#XTIT: Not found view title\r\nnotFoundTitle=Not Found\r\n\r\n#YMSG: The Sales Orders not found text is displayed when there is no Products with this id\r\nnoObjectFoundText=This Sales Order is not available\r\n\r\n#YMSG: The Sales ORders not available text is displayed when there is no data when starting the app\r\nnoObjectsAvailableText=No Sales Orders are currently available\r\n\r\n#YMSG: The not found text is displayed when there was an error loading the resource (404 error)\r\nnotFoundText=The requested resource was not found\r\n\r\n#~~~ Error Handling ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#YMSG: Error dialog description\r\nerrorText=Sorry, a technical error occurred! Please try again later.\r\n\r\n\r\n#~~~ Status Codes ~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XSEL, 10: Open status label that specifies the Open Order Items count\r\nSTATUS_A=Open\r\n\r\n#XSEL, 15: In Process status label that specifies the In Process Order Items count\r\nSTATUS_B=In Process\r\n\r\n#XSEL, 15: Shipped status label that specifies the Shipped Order Items count\r\nSTATUS_C=Shipped\r\n\r\n#XSEL, 15: Delivery status label that specifies the  Order Items status\r\nSTATUS_NR=Not Relevant\r\n\r\n#XSEL, 15: Delivery status label that specifies the  Order Items status\r\nSTATUS_NS=Not Shipped\r\n\r\n#XSEL, 15: Delivery status label that specifies the  Order Items status\r\nSTATUS_PS=Partially Shipped\r\n\r\n#XSEL, 15: Delivery status label that specifies the  Order Items status\r\nSTATUS_SH=Shipped\r\n\r\n#XSEL, 15: Delivery status label that specifies the  Order Items status\r\nNO_STATUS_=Not Defined\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_OP=Open\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_IP=In Process\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_CP=Completed\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_RJ=Rejected\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_PR=Partially Rejected\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_CB=Credit Block\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_DB=Delivery Block\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_PB=Partial Block\r\n\r\n#XSEL, 15: Overall status label that specifies the  Order Items status\r\nSTATUS_PD=Partial Delivery Block",
